import React, { useState } from 'react';
import styled from 'styled-components/native';
import { FlatList } from 'react-native'

const HomePage = () => {
    const [name, setName] = useState('Edith')
    const [age, setAge] = useState('4');
    const [family, setFamily] = useState([
        { name: 'Nathalie', id: 'mother' },
        { name: 'Daniel', age: 'fater' },
        { name: 'Edith', age: 'daugther' },
        { name: 'Frank', age: 'son' },
    ]);



    return (
        <Container>
            <Header>
                <Title>Home Page</Title>
            </Header>
            <Body>
                <Text>Enter Name:</Text>
                <InputBox>
                    <Input
                        placeholder='...'
                        onChangeText={(val) => setName(val)}
                    />
                </InputBox>
                <Text>Enter age:</Text>
                <InputBoxTwo>
                    <InputTwo
                        keyboardType='numeric'
                        placeholder='...'
                        onChangeText={(val) => setAge(val)}
                    />
                </InputBoxTwo>

                <Text>My name is {name} and I am {age} years old</Text>


                {/* { family.map((item) => {
                    return (
                        <View key={item.id}>
                            <Text>
                                {item.name} 
                            </Text>
                        </View>
                    )
                })} */}


            </Body>
            <Footer></Footer>
        </Container>
    )

}

const Container = styled.View`
    background-color: white;
`

const Title = styled.Text`
    font-size: 20px;
`

const Text = styled.Text`
  color: pink;
`
const View = styled.View`
    background-color: black;
    margin-top: 20px;
    border: solid grey 1px;
    padding: 10px 0 10px 10px;
    width: 200px;

 `


const Header = styled.View`
    background-color: pink;
    padding: 50px;
    width: 100%;
    justify-content: center;
    align-items: center;
`

const Body = styled.View`
    background-color: black;
    width: 100%;
    height:600px;
    color: white;
    justify-content: center;
    align-items: center;
`

const InputBox = styled.View`
    border: solid grey 1px;
    border-radius:10px;
    height:40px;
    width: 140px;
    margin-bottom: 10px;
    color: white;
`

const Input = styled.TextInput`
    padding-left: 10px;
    margin-top: 10px;
    color: pink;

`

const InputBoxTwo = styled.View`
    border: solid grey 1px;
    border-radius:10px;
    height:40px;
    width: 140px;
    margin-bottom: 10px;
`

const InputTwo = styled.TextInput`
    padding-left: 10px;
    margin-top: 10px;
    color: pink;
`




const Footer = styled.View`
    background-color: pink;
    padding: 50px;
    width: 100%;
`



export default HomePage;
